import { useEffect, useState } from 'react';
import axios from 'axios';
import './PurchaseList.css';
import PurchaseData from './purchasesData/PurchaseList';

function PurchaseList() {

  const [data, setData] = useState([])

  useEffect(()=>{
    axios.get('http://localhost:8000/api/purchases')
    .then(resp => setData(resp.data))
    .then(resp => console.log(resp.data));
  }, []);


  return (
    <table>
      <thead>
        <tr>
          <td>#</td>
          <td>Purchase Date</td>
          <td>Purchase Place</td>
          <td>Payed By</td>
          <td>Offer document</td>
          <td>Purchasement document</td>
          <td>Prepayment document</td>
          <td>Final payment document</td>
          <td>invoice</td>
          <td>Other documents</td>
          <td>Comments</td>
          <td>Purchase finished</td>
          <td>Options</td>
        </tr>
      </thead>
      <tbody>
        {data && <PurchaseData data={data} />}
      </tbody>
    </table>
  )
}

export default PurchaseList;
